  CartHandler.prototype.set_state_tax = function (state_id) {
    var product_rate = null;
    var shipping_rate = null;
    var shipping_tax_class = null;
    var tax_entries = [];
    var me = this;
    me.state_tax = { label: null, total: null };
    if (me.shipping > 0) {
      if (site.checkout.shipping_method) {
        var rates = site.config.get("checkout.shipping", {});
        Object.keys(rates).forEach(function (code) {
          rates[code].rates.forEach(function (rate) {
            if (
              rate.method + "_" + rate.code ==
              site.checkout.shipping_method
            ) {
              shipping_tax_class = rate.tax_class;
            }
          });
        });
      } else {
        me.shipping = 0;
      }
    }
    Object.values(site.data.tax).forEach(function (tax) {
      tax.rates.forEach(function (rate) {
        if (rate.tax_region_id == state_id) {
          product_rate = rate;
          me.state_tax.label = tax.code;
          if (rate.product_tax_class == shipping_tax_class) {
            shipping_rate = rate;
          }
        }
      });
    });
    if (!this.use_rates) {
      me.state_tax.total = 0;
    } else {
      if (product_rate) {
        site.cart.items.forEach(function (item) {
          var product = site.data.get_product(item.product_id);
          if (product && product_rate.product_tax_class == product.tax_class) {
            var price =
              (item.price * item.form_request.qty * product_rate.rate) / 100;
            var toadd = {
              product_id: item.product_id,
              sku: item.sku,
              total: item.price * item.form_request.qty,
              rate: product_rate.rate,
              price: price,
            };
            tax_entries.push(toadd);
          }
        });
      }
      if (shipping_rate) {
        var price = (site.cart.shipping * shipping_rate.rate) / 100;
        var toadd = {
          shipping: 1,
          total: site.cart.shipping,
          rate: shipping_rate.rate,
          price: price,
        };
        tax_entries.push(toadd);
      }
      if (tax_entries.length > 0) {
        var discount_amount = 0;
        if (me.coupon) {
          discount_amount = me.coupon.get_discount(me) * 100;
        }
        var sum = 0;
        tax_entries.forEach(function (entry) {
          if (discount_amount > 0 && entry.rate > 0 && !entry.shipping) {
            var adjustment = Math.min(entry.total, discount_amount);
            var new_total = entry.total - adjustment;
            discount_amount -= adjustment;
            if (new_total > 0) {
              entry.price = (new_total * entry.rate) / 100;
            } else {
              entry.price = 0;
            }
          }
          sum += entry.price;
        });
        me.state_tax.total = Math.round(sum);
      } else {
        me.state_tax.total = 0;
      }
    }
  };
